import React from "react";
import FooterRow from "./FooterRow";

const FooterColumn = (props) => {
  return (
    <div>
      {props.values.map((dataFooter) => (
        <FooterRow value={dataFooter} />
      ))}
    </div>
  );
};

export default FooterColumn;
